	add("sprog", "{\"term\":\"sprog\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"middle low german\", \"Dutch\", \"Norwegian\", \"Swedish\"], \"text\":\"From Middle low german {{m|gml|sprāke}}. Cognate to German \u0027sprache\u0027 Dutch \u0027spraak\u0027 Norwegian \u0027språk\u0027 Old english (ca. 450-1100) {{m|ang|sprǣċ}} and Swedish \u0027språk\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A child\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027 September 13, Donald Gould, \u0027Forum: Suck it and see\u0027, [http://books.google.com.au/books?id\u003dvABtGA6t9-IC\u0026amp;pg\u003dPA54\u0026amp;lpg\u003dPA54\u0026amp;dq\u003d%22sprogs%22+child+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003duF3tS7AXyG\u0026amp;sig\u003dNNnDr1AWDyIRx_Cgm3zfsWzOq3M\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFGFgUMuLAa6TiQf9loGQAQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sprogs%22%20child%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 54\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"To test this hypothesis further, he and his mate Fifer persuaded 16 women, heavy with child, to read a story called \u0027The Cat in the Hat\u0027 to their unborn \u0027\u0027sprogs\u0027\u0027, twice a day, during the last few weeks of their pregnancies\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Julian Knight, \u0027Wills, Probate, \u0026amp; Inheritance Tax For Dummies\u0027, UK Edition, [http://books.google.com.au/books?id\u003dxutd9gD9KmIC\u0026amp;pg\u003dPT130\u0026amp;lpg\u003dPT130\u0026amp;dq\u003d%22sprogs%22+child+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d3FbjQUZAZS\u0026amp;sig\u003d38l7eIcXG_3dEJGw1WPDrD22LVM\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFGFgUMuLAa6TiQf9loGQAQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sprogs%22%20child%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any guardianship or trusts that you set up when your children were little \u0027\u0027sprogs\u0027\u0027 may no longer be needed\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Brett Atkinson, Sarah Bennett, Scott Kennedy, \u0027New Zealand′s South Island\u0027, Lonely Planet, [http://books.google.com.au/books?id\u003dEWYaU5OL-BgC\u0026amp;pg\u003dPA220\u0026amp;lpg\u003dPA220\u0026amp;dq\u003d%22sprogs%22+child+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d5pKGt9bnR2\u0026amp;sig\u003dKPDHXcFr3CUID2x5JdxlGV81oqY\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFGFgUMuLAa6TiQf9loGQAQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sprogs%22%20child%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 220\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Kids will love the climbing wall and NZ′s highest vertical slide. If the \u0027\u0027sprogs\u0027\u0027 get bored with reality, movie make-believe (p232) is right next door\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A new recruit\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Semen\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A deflection-limiting safety device used in high performance hang gliders\", \"priority\":13}]}, \"synonyms\":{}}");

