	add("spruce", "{\"term\":\"spruce\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"prussian\"], \"text\":\"From Middle english (1100-1500) an alteration of {{m|enm|Pruce||Prussia}}, from from a language, probably Prussian for more, see \u0027\u0027\u0027Prussia\u0027\u0027\u0027. {{m|enm|Spruce}}, {{m|enm|spruse}} (1412), and {{m|enm|Sprws}} (1378) were terms for commodities brought to England by {{w|Hanseatic League|Hanseatic merchants}} (beer, wood, leather). The tree with this name was also believed to have been native to Prussia. The adjective and verb senses (\u0026quot;trim, neat\u0026quot; and \u0026quot;to make trim, neat\u0026quot;) are attested from 1594, and originate with \u0027spruce leather\u0027 (1466), which was used to make a popular style of jerkins in the 1400s that was considered smart-looking.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various large coniferous evergreen trees from the genus \u0027Picea\u0027, found in northern temperate and boreal regions; originally and more fully spruce fir\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The wood of a spruce\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Made of the wood of the spruce\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That \u0027\u0027spruce\u0027\u0027 table is beautiful\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Prussia Prussia or Prussian leather; pruce\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"E. Phillip\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Spruce\u0027\u0027, a sort of leather corruptly so called for Prussia leather\", \"priority\":7}]}, \"synonyms\":{}}");

