	add("spruceness", "{\"term\":\"spruceness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|spruce|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the property of being spruce, of being neat and elegant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("spruiker", "{\"term\":\"spruiker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|spruik|er|gloss2\u003dsuffix generating agent noun|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who spruiks business, a tout\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Mark St Leon, \u0027The Wizard of the Wire: The Story of Con Colleano\u0027, Aboriginal Studies Press, Australia, %22spruikers%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dBOeWdy4pV1\u0026amp;sig\u003dsMGnSUzd126RyW201UsKltnj1mo\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddKJhUOfyMYaTiAediIGIAQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22spruikers%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 9\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027spruiker\u0027\u0027 then asked, “Now we want to know, will anyone have a go at the heavyweight? If anyone can stand four rounds we will give them a five-pound note and the best bottle of wine in the town”\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Sim Shen, \u0027Hanoi and Other Homes\u0027, Alice Pung (editor), \u0027Growing Up Asian in Australia\u0027, %22spruikers%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d3a7euGFySb\u0026amp;sig\u003diUo35Ogcwx33eB9vcy4b2BKrmgs\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddKJhUOfyMYaTiAediIGIAQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22spruikers%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 338\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Our days were filled with new sensations – the bite of every dragon fruit, the smell of roasting meat emanating from the dog restaurants near the Red River, the endless chatter of \u0027\u0027spruikers\u0027\u0027 and peddlers\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Kate Darian-Smith, \u0027On the Home Front: Melbourne in Wartime: 1939-1945\u0027, 2nd Edition, %22spruikers%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d6in7C89rog\u0026amp;sig\u003dopzys0Tnz1NUEygmVyKxwQQ30XE\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddKJhUOfyMYaTiAediIGIAQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22spruikers%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 170\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"At the convention of the Victorian Protestant Federation G. A. Judkins alleged that attractive young girls were used as \u0027\u0027spruikers\u0027\u0027, luring Melburnians to gamble.\u0026lt;sup\u0026gt;71\u0026lt;/sup\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"One who toot one\u0027s own toots their own horn\", \"priority\":11}]}, \"synonyms\":{}}");

